import { genres } from "../services/fakeGenreService";

const Genres = ({ movies }) => {
  console.log(movies);
  return (
    <ul class="list-group">
      <li class="list-group-item">All Genres</li>
      {movies.map}
    </ul>
  );
};

export default Genres;
